import React from 'react'
import { withRouter } from 'react-router-dom'
import injectSheet from "react-jss";
import styles from './EmptyCartStyles'

const EmptyCart = (props) => {

    const {classes} = props;

    const goHome = () => {
        props.history.push('/')
    }
        return (
            <div className={classes.emptyList}>
                <div className={classes.header}>Cart List is Empty! </div>
                <div className={classes.header}>Go back to home page and add some products to cart list! </div>
                <div>
                    <button className={classes.btnGoHome} onClick={goHome}>
                        Go to home page
                    </button>
                </div>
            </div>
        )
    }

export default withRouter(injectSheet(styles)(EmptyCart))
